  \"Disaster Emergency Medical Personnel System (DEMPS)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 76,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-08-21T22:33:28.399669\",\n\t\"name\": \"disaster-emergency-medical-personnel-system-demps\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Disaster Emergency Medical Personnel
  System (DEMPS) is the Veterans Health Administrations main deployment program for
  clinical and non-clinical staff to an emergency or disaster. The DEMPS Program may
  be used for an internal VA mission, as well as supporting a mission after a Presidential
  Disaster Declaration under the National Response Frameworks Emergency Support Function
  #8 (Public Health and Medical Services). Interested, qualified VHA staff can apply
  online by submitting a DEMPS Application. DEMPS Coordinators and Administrators
  can manage volunteer data by accessing DEMPS Administration.The DEMPS Program is
  made up of the following entities:The DEMPS Volunteers (Full-time VHA employee,
  or Retiree Emergency Reserve Corps Volunteer (ERC)) VAMC DEMPS Coordinator DEMPS
  VAMC Facility Support Staff (Fiscal, Payroll, and Travel) DEMPS VISN Points of Contact
  DEMPS National Program Manager VHA Office of Emergency Management staff (Area Emergency
  Managers, and Regional Emergency Managers) Deputy Under Secretary for Health for
  Operations and Management, and The DEMPS database. In order for DEMPS to work successfully,
  all eight entities above must work together to deploy the DEMPS Volunteer to an
  emergency or disaster site.The DEMPS database was developed to collect specific
  information on full-time VHA medical personnel (clinical and non-clinical) and Retiree
  Emergency Reserve Corps (ERC) Volunteers who have volunteered and been approved
  by their Medical Center Director to be deployed (full-time staff or ERC Volunteers)
  in the event of a disaster, or to back fill a medical center (ERC Volunteers). When
  disasters such as hurricanes, earthquakes, floods, etc., occur and the state and
  local resources to handle the response/recovery process are overwhelmed, the state
  in which the disaster occurs may request federal assistance. In this case, a Presidential
  Disaster Declaration is issued and the National Response Framework (NRF) is activated.
  Once the damage to the area and needs have been assessed, and it is determined that
  medical resources are required, the Federal Emergency Management Agency (FEMA) or
  the Department of Health and Human Services (HHS) may task VA to provide these resources.
  Generally, these requests are for medical personnel (nurses, physicians, pharmacists,
  etc.), pharmaceutical (or other medical) supplies, and medical equipment. However,
  depending on the mission, VHA may deploy non-clinical staff to support the infrastructure
  of the deployment.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
